import styled from 'styled-components'
import Footer from './components/Footer';
import Notification from './components/Notification';


const Container = styled.div`
  width: 100vw;
  height: 100vh;
  background-color: #fff;
`

function App() {
  return (
    <Container>
      <Notification />
      <Footer />
    </Container>
  );
}

export default App;
